import "./App.css";
import { BrowserRouter, Routes, Route} from "react-router-dom";
import { PrimeReactProvider } from "primereact/api";
import FirstPage from "./FirstPage";
function App() {
  return (

    <PrimeReactProvider>
     <div>
      <BrowserRouter>
      <Routes>
        <Route path="/"  element={ <FirstPage />} />
      </Routes>

      </BrowserRouter>
    </div>
</PrimeReactProvider>

  );
}

export default App;
